export class ChatMessageDto {
  name: string;
  message: string;
  photo?: string;
  fileName?: string;
  fileType?: string;

  constructor(name: string, message: string, photo?: string, fileName?: string, fileType?: string) {
    this.name = name;
    this.message = message;
    this.photo = photo;
    this.fileName = fileName;
    this.fileType = fileType;
  }
